-- RESPOSTA QUESTÃO

CREATE TABLE CONDOMINIO (
	IDCONDOMINIO INT,
    NOME_CONDOMINIO VARCHAR(100),
    PRIMARY KEY (IDCONDOMINIO)
    );
    
CREATE TABLE BLOCO (
	IDBLOCO INT,
	NOME_BLOCO VARCHAR(25),
	PRIMARY KEY (IDBLOCO)
    );
    
CREATE TABLE APARTAMENTO (
	IDAPARTAMENTO INT,
	NUMERO_APARTAMENTO INT,
	ANDAR_APARTAMENTO INT,
	TAMANHO_APARTAMENTO FLOAT,
    PRIMARY KEY (IDAPARTAMENTO)
    );

CREATE TABLE PROPRIETARIO (
	IDAPARTAMENTO INT,
    IDPROPRIETARIO INT,
	NOME_PROPRIETARIO VARCHAR(100),
    PRIMARY KEY (IDPROPRIETARIO),
    FOREIGN KEY (IDAPARTAMENTO) REFERENCES APARTAMENTO (IDAPARTAMENTO)
    );

CREATE TABLE MORADOR (
	IDAPARTAMENTO INT,
    IDMORADOR INT,
	NOME_MORADOR VARCHAR(100),
    PRIMARY KEY (IDMORADOR),
	FOREIGN KEY (IDAPARTAMENTO) REFERENCES APARTAMENTO (IDAPARTAMENTO)

    );
    
CREATE TABLE VISITANTE (
	IDAPARTAMENTO INT,
    IDVISITANTE INT,
	NOME_VISITANTE VARCHAR(100),
	DTVISITA DATE,
    PRIMARY KEY (IDVISITANTE),
	FOREIGN KEY (IDAPARTAMENTO) REFERENCES APARTAMENTO (IDAPARTAMENTO)

    );
    
INSERT INTO CONDOMINIO (IDCONDOMINIO, NOME_CONDOMINIO)
SELECT DISTINCT IDCONDOMINIO, NOME_CONDOMINIO
FROM CONDOMINIO_COMPLETO;

INSERT INTO BLOCO (IDBLOCO, NOME_BLOCO)
SELECT DISTINCT IDBLOCO, NOME_BLOCO
FROM CONDOMINIO_COMPLETO;

INSERT INTO APARTAMENTO (IDAPARTAMENTO, NUMERO_APARTAMENTO, ANDAR_APARTAMENTO, TAMANHO_APARTAMENTO)
SELECT DISTINCT IDAPARTAMENTO, NUMERO_APARTAMENTO, ANDAR_APARTAMENTO, TAMANHO_APARTAMENTO
FROM CONDOMINIO_COMPLETO
WHERE IDAPARTAMENTO IS NOT NULL;

INSERT INTO PROPRIETARIO (IDAPARTAMENTO, IDPROPRIETARIO, NOME_PROPRIETARIO)
SELECT DISTINCT IDAPARTAMENTO, IDPROPRIETARIO, NOME_PROPRIETARIO
FROM CONDOMINIO_COMPLETO
WHERE IDAPARTAMENTO AND IDPROPRIETARIO IS NOT NULL;

INSERT INTO MORADOR(IDAPARTAMENTO, IDMORADOR, NOME_MORADOR)
SELECT DISTINCT IDAPARTAMENTO, IDMORADOR, NOME_MORADOR
FROM CONDOMINIO_COMPLETO
WHERE IDAPARTAMENTO AND IDMORADOR IS NOT NULL;


INSERT INTO VISITANTE (IDAPARTAMENTO, IDVISITANTE, NOME_VISITANTE, DTVISITA)
SELECT DISTINCT IDAPARTAMENTO, IDVISITANTE, NOME_VISITANTE, DTVISITA
FROM CONDOMINIO_COMPLETO
WHERE IDAPARTAMENTO AND IDVISITANTE IS NOT NULL;

